import{_ as t,c as e,o,N as a}from"./chunks/framework.1e6a71f2.js";const b=JSON.parse('{"title":"快速开始","description":"","frontmatter":{},"headers":[{"level":2,"title":"新建 GitHub 仓库","slug":"新建-github-仓库","link":"#新建-github-仓库","children":[]},{"level":2,"title":"新建 GitHub Token","slug":"新建-github-token","link":"#新建-github-token","children":[]},{"level":2,"title":"绑定 GitHub 仓库","slug":"绑定-github-仓库","link":"#绑定-github-仓库","children":[]},{"level":2,"title":"上传图片","slug":"上传图片","link":"#上传图片","children":[]},{"level":2,"title":"复制图片链接","slug":"复制图片链接","link":"#复制图片链接","children":[]}],"relativePath":"usage-guide/get-start.md","lastUpdated":1678980748000}'),i={name:"usage-guide/get-start.md"},r=a('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-label="Permalink to &quot;快速开始&quot;">​</a></h1><h2 id="新建-github-仓库" tabindex="-1">新建 GitHub 仓库 <a class="header-anchor" href="#新建-github-仓库" aria-label="Permalink to &quot;新建 GitHub 仓库&quot;">​</a></h2><p><strong><a href="https://github.com/new" target="_blank" rel="noreferrer">创建</a></strong> 一个用来存储图片的GitHub 仓库，仓库属性必须选<code>Public</code> 。</p><blockquote><p>点击链接 <a href="https://github.com/new" target="_blank" rel="noreferrer">https://github.com/new</a> 快速新建仓库</p></blockquote><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.4l8bpu1a3g80.webp" alt="image"></p><br><h2 id="新建-github-token" tabindex="-1">新建 GitHub Token <a class="header-anchor" href="#新建-github-token" aria-label="Permalink to &quot;新建 GitHub Token&quot;">​</a></h2><p><strong><a href="https://github.com/settings/tokens/new" target="_blank" rel="noreferrer">创建</a></strong> 一个带有 repo 权限的 GitHub Token 。</p><blockquote><p>点击链接 <a href="https://github.com/settings/tokens/new" target="_blank" rel="noreferrer">https://github.com/settings/tokens/new</a> 快速新建 Token</p></blockquote><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.6v6eljwpbic0.webp" alt="image"></p><p><strong>注意：新生成的 Token 只会显示一次，请妥善保存，如有遗失，重新生成即可。</strong></p><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.2xaz8zkgpsq0.webp" alt="image"></p><br><h2 id="绑定-github-仓库" tabindex="-1">绑定 GitHub 仓库 <a class="header-anchor" href="#绑定-github-仓库" aria-label="Permalink to &quot;绑定 GitHub 仓库&quot;">​</a></h2><p>使用 Chrome 或 Edge 等现代浏览器进入 <strong><a href="https://picx.xpoet.cn" target="_blank" rel="noreferrer">PicX 图床官网</a></strong>，填写前面新建的 GitHub Token，完成图床和仓库绑定。</p><ol><li><p>填写 Token，自动获取该用户下的所有 Public 仓库。</p><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.1mfb0ql5oobk.webp" alt="image"></p></li><li><p>在选择仓库的下拉列表中，选择刚刚新建的那个仓库作为图床。</p><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.413c26zwvce0.webp" alt="image"></p></li><li><p>选择一种目录方式（目录即仓库里存放图片的文件夹）。</p><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.1l7vt0k0osn4.webp" alt="image"></p><ul><li><p>新建目录：需手动输入一个新目录。</p><blockquote><p>使用 <code>/</code> 可创建多级目录，例如：输入<code>A01/A02</code> 表示创建二级目录，最大支持创建到五级目录。</p></blockquote></li><li><p>根目录：图片将存储在仓库根目录下。</p></li><li><p>自动目录：自动生成日期格式 <code>yyyyMMdd</code> 的目录。例如：<code>20230203</code>。</p></li></ul></li></ol><br><h2 id="上传图片" tabindex="-1">上传图片 <a class="header-anchor" href="#上传图片" aria-label="Permalink to &quot;上传图片&quot;">​</a></h2><ul><li><p>可以通过 <strong>拖拽图片</strong> 到上传区域进行上传。</p></li><li><p>可以通过 <strong>复制图片</strong>，然后 <strong>粘贴</strong> 到上传区域进行上传。</p><blockquote><p>粘贴图片快捷键 <strong><code>ctrl + v</code></strong> 或 <strong><code>command + v</code></strong></p></blockquote></li><li><p>可以通过点击上传区域，<strong>选择图片</strong> 进行上传。</p></li></ul><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.3vetpkpyiqy0.webp" alt="image"></p><p>点击 <strong>上传</strong> 按钮或使用快捷键 <strong><code>ctrl + s</code></strong> 或 <strong><code>command + s</code></strong> 开始上传图片</p><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.22mpe4toc9cw.webp" alt="image"></p><br><h2 id="复制图片链接" tabindex="-1">复制图片链接 <a class="header-anchor" href="#复制图片链接" aria-label="Permalink to &quot;复制图片链接&quot;">​</a></h2><p>图片上传成功后，会自动生成图片链接并复制到系统剪贴板，通过快捷键 <strong><code>ctrl + v</code></strong> 或 <strong><code>command + v</code></strong> 就可以拿去粘贴使用了。</p><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/image.2qphf8jd65q0.webp" alt="image"></p>',26),s=[r];function c(n,l,g,p,h,m){return o(),e("div",null,s)}const u=t(i,[["render",c]]);export{b as __pageData,u as default};
